import AxiosInstance from "./AxiosInstance";

//INSCRIPTION
export const Register = async (data) => {

    try {
        const body = {
            username: data.username,
            password: data.password
        }
        console.log("API", body)
        const config = {
            headers: {
                'Authorization': 'Bearer your_access_token', // Exemple d'en-tête d'autorisation
                'Custom-Header': 'Custom-Value' // Exemple d'en-tête personnalisé supplémentaire
            }
        };

        const result = await AxiosInstance.post('/api/createUser', body, config);


        return result.data

    } catch (error) {
        console.error("Erreur lors de l'inscription :", error);
        throw error;
    }
}
